import React from "react";
import { Nav } from "@fluentui/react/lib/Nav";
import { Link, Outlet } from "react-router-dom";

const navLinkGroups = [
  {
    name: "Basic components",
    links: [
      {
        key: "<Overview>",
        name: "Overview",
        url: "/overview",
      },
    ],
  },
];

const NavigationBar = () => {
  return (
    <div>
      <nav>
        <ul>
          <li>
            <Link to="/">Home</Link>
          </li>
          <li>
            <Link to="/overview">Overview</Link>
          </li>
        </ul>
      </nav>
    </div>
  );
};

export default NavigationBar;
